import React, {Component} from "react";
// import AddNumber from "../containers/AddNumber";
// import DisplayNumber from "../containers/DisplayNumber";
import TopLeft from "../containers/TopLeft";
import TopMid from "../containers/TopMid";
import TopRight from "../containers/TopRight";
import News from "../containers/News";
import Group from "../containers/Group";
import Footer from "../containers/Footer";
export default class AddNumberRoot extends Component{
    render(){
      return (
        <div>
            <div className="flex">
                <div className="c-15"><TopLeft/></div>
                <div className="c-70"><TopMid/></div>
                <div className="c-15"><TopRight/></div>
            </div>
            <div className="flex">
                <div className="c-100"><News/></div>
            </div>
            <div className="flex">
                <div className="c-50">asdfa</div>
                <div className="c-50"><Group/></div>
            </div>
            <div className="flex">
            <div className="c-100"><Footer/></div>
            </div>
        </div>

      )
    }
  }
